    def getVector(self, file):
        pe = pefile.PE(file)
        mal_import_dict = dict()
        for _import in self.mal_imports:
            mal_import_dict[_import] = 0
        try:
            for importeddll in pe.DIRECTORY_ENTRY_IMPORT:
                for importedapi in importeddll.imports:
                    try:
                        import_name = bytes.decode(importedapi.name)
                        if import_name in self.mal_imports:
                            mal_import_dict[import_name] = 1
                    except TypeError:
                        continue
        except AttributeError:
            return [0]*self.size
        return list(map(lambda x: mal_import_dict[x], mal_import_dict))

    def isMalware(self, file):
        data = self.getVector(file)
        _, output = torch.max(self.model(torch.from_numpy(np.array(data)).type(
            torch.FloatTensor)), -1)
        if int(output) == 1:
            return True
        else:
            return False